import React, { useState } from 'react';
import './Css/Menubar.css';
import { useNavigate } from 'react-router-dom';
import contactimg from './Images/contact.png';
import whitelistimg from './Images/whitelist.png';
import DescriptionComponent from './DescriptionComponent';

export default function MenuBar() {
    const navigate = useNavigate();
    const [activesection, setActiveSection] = useState('');
    const [imagesize, setimagesize] = useState({
        height: {
            whitelist: 5,
            contact: 75,
        },
        width: {
            whitelist: 10,
            contact: 75,
        }
    });

    const handletoggle = (section) => {
        // Veksle mellom 책 책pne/lukke seksjoner
        setActiveSection(activesection === section ? '' : section);
    }

    const handleClose = () => {
        // Lukk den aktive seksjonen
        setActiveSection('');
    }

    return (
        <div className='menubar'>
            <div className='Menubar-list'>
                <ul style={{
                    backgroundImage: `url(${whitelistimg})`, 
                    backgroundSize: 'cover',
                    backgroundPosition: 'center', 
                    backgroundRepeat: 'no-repeat', 
                    height: `${imagesize.height.whitelist}`, 
                    width: `${imagesize.width.whitelist}`
                }} 
                className='Whitelist' 
                onClick={() => navigate('/PageComponent')}></ul>

                <ul onClick={() => handletoggle('VideoUpscaler')}>
                    <span>LearnReflect's AI Videoupscaler</span>
                    {activesection === 'VideoUpscaler' && (
                        <DescriptionComponent 
                            title='Video Upscaler' 
                            description='...'
                            onClose={handleClose} // Bruk handleClose her
                        />
                    )}
                </ul>

                <ul onClick={() => handletoggle('AudioUpscaler')}>
                    <span>LearnReflect's AI AudioUpscaler</span>
                    {activesection === 'AudioUpscaler' && (
                        <DescriptionComponent 
                            title='Audio Upscaler' 
                            description='...'
                            onClose={handleClose} // Bruk handleClose her
                        />
                    )}
                </ul>

                <ul onClick={() => handletoggle('description')}>
                    <span>LearnReflect's AI Chatbot</span>
                    {activesection === 'description' && (
                        <DescriptionComponent 
                            title='LearnReflects AI Chatbot' 
                            description='...'
                            onClose={handleClose} // Bruk handleClose her
                        />
                    )}
                </ul>

                <ul onClick={() => { navigate('./ContactNavBar') }} style={{ backgroundImage: `url(${contactimg})`, height: `${imagesize.height.contact}px`, width: `${imagesize.width.contact}`, backgroundSize: 'cover' }}>
                    {activesection === 'contact' && <li></li>}
                </ul>
            </div>
        </div>
    );
}
